def extract_data(s):
    if s.isupper():
        return sum((1 for i in s if (ord(i) - ord('A')) % 2 == 0))
    data = {'upper': 0, 'lower': 0, 'digits': 0, 'others': 0}
    for i in s:
        if i.isupper():
            data['upper'] += 1
        elif i.islower():
            data['lower'] += 1
        elif i.isdigit():
            data['digits'] += 1
        else:
            data['others'] += 1
    if data['upper'] > 0 and data['lower'] > 0 and (data['digits'] > 0) and (data['others'] > 0):
        return data
    else:
        return [i for i in s.replace(';', ' ').replace(',', ' ').split() if i]

